import React, { useEffect } from "react";
import Card from "@material-ui/core/Card";
import CardActions from "@material-ui/core/CardActions";
import CardContent from "@material-ui/core/CardContent";
import "./TopProg.css";
import { Typography, CardMedia } from "@material-ui/core";
import axios from "./axios";

function TopProg() {
  return (
    <div className="topProgs">
      <h1>Top Competitive Programmers around the globe!</h1>
      <div className="topProgs_cards">
        <Card>
          <CardContent>
            <CardMedia
              style={{ height: "100px", width: "150px", paddingTop: "56.25%" }}
              image={
                "https://userpic.codeforces.com/512496/title/5e6e92ed0d9fc9f4.jpg"
              }
            />
            <Typography color="textPrimary">name</Typography>
          </CardContent>
        </Card>
      </div>
    </div>
  );
}

export default TopProg;

